import React, { useEffect, useCallback } from 'react';

import Parser from '../../modules/Parser';

const Viewer = () => {
  const getParseEpub = useCallback(async (): Promise<null> => {
    // const test = new Parser('../../datum/epubs/pg61612.epub');
    // const res = await test.parse();

    // console.log(res);
    return null;
  }, []);

  useEffect(() => {
    getParseEpub();
  }, [getParseEpub]);


  return (
    <>
      Viewer Component
    </>
  );
};

export default Viewer;
